import React from "react";
import {
  Button,
  Checkbox,
  Form,
  Input,
  Radio,
  Select,
  TextArea,
  Transition
} from "semantic-ui-react";
const Place_Definer = ({ Card_Inform, visible, OnClosed, OnSumbit }) => {
  const options = [
    { key: "m", text: "Male", value: "male" },
    { key: "f", text: "Female", value: "female" },
    { key: "o", text: "Other", value: "other" }
  ];

  return (
    <Transition visible={visible} animation="fade up" duration={1200}>
      <div
        style={{
          position: "absolute",
          bottom: "0%",
          width: "100%"
        }}
      >
        <div className="ui segment">
          <Form>
            <Form.Group widths="equal">
              {/* <Form.Field control={Input} label="Shop Name" placeholder="First name" /> */}
              <Form.Field
                control={Select}
                label="_"
                options={options}
                placeholder="Shop Type"
              />
            </Form.Group>
          </Form>
        </div>
      </div>
    </Transition>
  );
};

export default Place_Definer;
